package com.ufgov.zc.server.bi.publish.impl;import java.util.List;import com.ufgov.zc.common.bi.model.BiIncome;import com.ufgov.zc.common.bi.publish.IBiIncomeServiceDelegate;import com.ufgov.zc.common.system.RequestMeta;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.server.bi.service.IBiIncomeService;public class BiIncomeServiceDelegate implements IBiIncomeServiceDelegate {  private IBiIncomeService biIncomeService;  public IBiIncomeService getBiIncomeService() {    return biIncomeService;  }  public void setBiIncomeService(IBiIncomeService biIncomeService) {    this.biIncomeService = biIncomeService;  }  public List getBiIncome(ElementConditionDto dto, RequestMeta requestMeta) {    return biIncomeService.getBiIncome(dto);  }  public String genBiIncomeId(BiIncome biIncome, RequestMeta requestMeta) {    return this.biIncomeService.genBiIncomeId(biIncome);  }  public void saveBiIncomeFN(List insertList, List updateList, RequestMeta requestMeta) {    biIncomeService.saveBiIncome(insertList, updateList);  }  public void deleteBiIncomeFN(List biIncomeIdList, RequestMeta requestMeta) {    biIncomeService.deleteBiIncome(biIncomeIdList);  }  public void auditBiIncomeFN(List biIncomeList, RequestMeta requestMeta) {    biIncomeService.auditBiIncome(biIncomeList);  }  public void unAuditBiIncomeFN(List biIncomeList, RequestMeta requestMeta) {    biIncomeService.unAuditBiIncome(biIncomeList);  }}